import React from 'react';

class Service extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container service'>
					<div className='row'>
						<div className='col-10 text-center'>
							<h2 className='service-title'>Why should you choose us?u</h2>
						</div>
					</div>
					<div className='row'>
						<div className='col-3'>Free shipping</div>
						<div className='col-3'>Easy payments</div>
						<div className='col-3'>Money-back guarantee</div>
						<div className='col-3'>Finest quality</div>
					</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Service;
